import Link from 'next/link';

const index = () => {
  return (
    <div>

      <Link href="/about">
        <a>About Page</a>
      </Link>
      <Link href="/">
        <a>home Page</a>
      </Link>
      <h1>Welcome to BitzPrice</h1>
    </div>
  )
}

export default index
